INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 7001, "2015/12/17 15:00:00", 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7, 106001, "キャル", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 7002, "2015/12/17 15:00:00", 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7, 105901, "コッコロ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 7003, "2015/12/17 15:00:00", 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7, 105801, "ペコリーヌ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 10001, "2015/12/17 15:00:00", 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10, 105801, "ペコリーヌ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 10002, "2015/12/17 15:00:00", 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10, 106001, "キャル", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 10003, "2015/12/17 15:00:00", 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10, 105901, "コッコロ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 2104010, 2, "2030/12/17 14:59:59", 1, 10004, "2015/12/17 15:00:00", 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10, 106401, "シェフィ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 12001, "2015/12/17 15:00:00", 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12, 105801, "ペコリーヌ", 0.0, -416.5, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 13001, "2015/12/17 15:00:00", 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13, 106001, "キャル", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 13002, "2015/12/17 15:00:00", 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13, 105901, "コッコロ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 2104010, 2, "2030/12/17 14:59:59", 1, 13003, "2015/12/17 15:00:00", 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13, 106401, "シェフィ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 13004, "2015/12/17 15:00:00", 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13, 105801, "ペコリーヌ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 14001, "2015/12/17 15:00:00", 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14, 105901, "コッコロ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 2104010, 2, "2030/12/17 14:59:59", 1, 14002, "2015/12/17 15:00:00", 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14, 106401, "シェフィ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 14003, "2015/12/17 15:00:00", 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14, 105801, "ペコリーヌ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 14004, "2015/12/17 15:00:00", 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14, 106001, "キャル", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 15001, "2015/12/17 15:00:00", 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15, 105901, "コッコロ", 0.0, -470.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 2104010, 2, "2030/12/17 14:59:59", 1, 16001, "2015/12/17 15:00:00", 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16, 106401, "シェフィ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 16002, "2015/12/17 15:00:00", 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16, 105801, "ペコリーヌ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 16003, "2015/12/17 15:00:00", 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16, 106001, "キャル", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 16004, "2015/12/17 15:00:00", 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16, 105901, "コッコロ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 17002, "2015/12/17 15:00:00", 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17, 105901, "コッコロ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 17004, "2015/12/17 15:00:00", 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 25, 106001, "キャル", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 17005, "2015/12/17 15:00:00", 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 25, 105901, "コッコロ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 2104010, 2, "2030/12/17 14:59:59", 1, 17006, "2015/12/17 15:00:00", 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 25, 106401, "シェフィ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 17007, "2015/12/17 15:00:00", 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 25, 105801, "ペコリーヌ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 18001, "2015/12/17 15:00:00", 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18, 190801, "カリン", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 18002, "2015/12/17 15:00:00", 2, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18, 190801, "カリン", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 19001, "2015/12/17 15:00:00", 3, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19, 190801, "カリン", 0.0, -470.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 19002, "2015/12/17 15:00:00", 4, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19, 190801, "カリン", 0.0, -470.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 20001, "2015/12/17 15:00:00", 5, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20, 190801, "カリン", 0.0, -470.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 20002, "2015/12/17 15:00:00", 6, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20, 190801, "カリン", 0.0, -470.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 21001, "2015/12/17 15:00:00", 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21, 106001, "キャル", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 21002, "2015/12/17 15:00:00", 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21, 105901, "コッコロ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 2104010, 2, "2030/12/17 14:59:59", 1, 21003, "2015/12/17 15:00:00", 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21, 106401, "シェフィ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 21004, "2015/12/17 15:00:00", 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21, 105801, "ペコリーヌ", 0.0, -363.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 22001, "2015/12/17 15:00:00", 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22, 190801, "カリン", 0.0, -430.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 22002, "2015/12/17 15:00:00", 2, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22, 190801, "カリン", 0.0, -430.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 23001, "2015/12/17 15:00:00", 3, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23, 190801, "カリン", 0.0, -430.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 23002, "2015/12/17 15:00:00", 4, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23, 190801, "カリン", 0.0, -430.0, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (4.08, 0, 1, "2030/12/17 14:59:59", 2, 24001, "2019/01/31 12:00:00", 1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, 109001, "エリコ（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (5.0, 0, 1, "2030/12/17 14:59:59", 2, 24002, "2019/01/31 12:00:00", 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, 109001, "エリコ（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (10.11, 0, 1, "2030/12/17 14:59:59", 2, 24003, "2019/01/31 12:00:00", 3, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, 109001, "エリコ（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (4.0, 0, 1, "2030/12/17 14:59:59", 2, 24004, "2019/01/31 12:00:00", 4, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, 109001, "エリコ（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (6.0, 0, 1, "2030/12/17 14:59:59", 2, 24005, "2019/01/31 12:00:00", 5, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, 109001, "エリコ（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24006, "2019/01/31 12:00:00", 6, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24007, "2019/01/31 12:00:00", 7, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24008, "2019/01/31 12:00:00", 8, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24009, "2019/01/31 12:00:00", 9, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24010, "2019/01/31 12:00:00", 10, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, 109002, "エリコ（バレンタイン）", 0.0, 0.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2.12, 0, 1, "2030/12/17 14:59:59", 2, 24011, "2019/01/31 12:00:00", 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, 109101, "シズル（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (4.19, 0, 5, "2030/12/17 14:59:59", 2, 24012, "2019/01/31 12:00:00", 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, 109101, "シズル（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (2.3, 0, 2, "2030/12/17 14:59:59", 4, 24013, "2019/01/31 12:00:00", 3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24, 109101, "シズル（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24014, "2019/01/31 12:00:00", 4, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24, 109102, "シズル（バレンタイン）", 0.0, 0.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (5.23, 0, 5, "2030/12/17 14:59:59", 2, 24015, "2019/01/31 12:00:00", 5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24, 109101, "シズル（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24016, "2019/01/31 12:00:00", 6, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24, 109102, "シズル（バレンタイン）", 0.0, 0.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (5.01, 0, 1, "2030/12/17 14:59:59", 2, 24017, "2019/01/31 12:00:00", 7, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24, 109101, "シズル（バレンタイン）", 8.0, -385.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24018, "2019/01/31 12:00:00", 8, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24, 109102, "シズル（バレンタイン）", 0.0, 0.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24019, "2019/01/31 12:00:00", 9, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24, 109102, "シズル（バレンタイン）", 0.0, 0.0, 10011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0, 1, "2030/12/17 14:59:59", 1, 24020, "2019/01/31 12:00:00", 10, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24, 109102, "シズル（バレンタイン）", 0.0, 0.0, 10011);
